import React from 'react';
import { useStep } from 'react-hooks-helper';
import { SignUp } from './sign/SignUp';
import { SignIn } from './sign/SignIn';

const steps = [
	{id : 'signin'},
	{id : 'signup'},
];

export const Sign = () => {

	const { step, navigation } = useStep({
		steps,
		initialStep: 0,
	});

	const props = {navigation};

	switch(step.id){
		case "signin":
			return <SignIn {...props} />;
		case "signup":
			return <SignUp {...props} />;
	};
}
